import React, { useState } from 'react';
import './Header.css';

const Header = ({ onNavigate }) => {
  const [searchTerm, setSearchTerm] = useState('');
  const [showPhotosDropdown, setShowPhotosDropdown] = useState(false);
  const [showProfessionalsDropdown, setShowProfessionalsDropdown] = useState(false);
  const [showAdviceDropdown, setShowAdviceDropdown] = useState(false);

  const photosDropdownItems = [
    { id: 'photos', name: 'Photos', hasSubmenu: true },
    { id: 'kitchen-dining', name: 'Kitchen & Dining', submenu: ['Kitchen', 'Modular Kitchen', 'Dining Room', 'Home Bar'] },
    { id: 'bed-bath', name: 'Bed & Bath', submenu: ['Bedroom', 'Nursery', "Kid's Room", 'Bathroom'] },
    { id: 'living', name: 'Living', submenu: ['Living Room', 'Home Theater', 'Home Office', 'Staircase'] },
    { id: 'outdoor', name: 'Outdoor', submenu: ['Garden', 'Patio', 'Terrace & Balcony', 'Courtyard'] },
    { id: 'more-rooms', name: 'More Rooms', submenu: ['Puja Room', 'Wardrobe', 'Exterior', 'Swimming Pool', 'View All'] }
  ];

  const handleSearch = () => {
    if (searchTerm.trim()) {
      alert(`Searching for: ${searchTerm}`);
      // In a real app, this would trigger search functionality
    }
  };

  const handleNavClick = (navItem) => {
    alert(`Navigating to ${navItem}`);
    // In a real app, this would use React Router
  };

  const handleSignIn = () => {
    alert('Opening Sign In modal');
    // In a real app, this would open authentication modal
  };

  const handleJoinAsPro = () => {
    alert('Opening Professional Registration');
    // In a real app, this would navigate to pro registration
  };

  return (
    <header className="header">
      <div className="container">
        <div className="header-content">
          <div className="logo">
            <img src="/logo.svg" alt="houzz" className="logo-img" />
          </div>
          
          <nav className="nav">
            <div className="nav-item dropdown" onClick={() => handleNavClick('Photos')}>
              <span>Photos</span>
              <span className="dropdown-arrow">‚ñº</span>
            </div>
            <div className="nav-item dropdown" onClick={() => handleNavClick('Find Professionals')}>
              <span>Find Professionals</span>
              <span className="dropdown-arrow">‚ñº</span>
            </div>
            <div className="nav-item dropdown" onClick={() => handleNavClick('Advice')}>
              <span>Advice</span>
              <span className="dropdown-arrow">‚ñº</span>
            </div>
          </nav>

          <div className="search-container">
            <input
              type="text"
              placeholder="Search Houzz"
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              onKeyPress={(e) => e.key === 'Enter' && handleSearch()}
              className="search-input"
            />
            <button className="search-btn" onClick={handleSearch}>üîç</button>
          </div>

          <div className="auth-buttons">
            <button className="btn btn-secondary" onClick={handleSignIn}>Sign In</button>
            <button className="btn btn-primary" onClick={handleJoinAsPro}>Join as a Pro</button>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
